import Logo from './logo.png';
import MediaQuery from 'react-responsive';

const styles = {
    navBar: {
        marginRight: '8.6%',
        marginLeft: '8.6%',
        display: 'flex',

    },

    box: {
        width: '163.281px',
        textAlign: 'left',
    },

    logo: {
        marginTop: '10px',
        height: '30px',
        marginBottom: '10px',
    },

    button: {

    }

};
export default function NB() {
    return (
        <div>
            <MediaQuery minWidth={1101}>
                <div style={styles.navbar}>
                    <div style={styles.box}>
                        <img style={styles.logo} src={Logo} />
                    </div>
                    <div style={styles.button}>

                    </div>
                </div>
            </MediaQuery>
        </div>
    );
}
